import React from 'react'

const SetBirthyear = (props) => {

    if (!props.show) {
        return null
      }


    return (
        <div>
            <form>
            <div>
                <input>Name:</input>
            </div>

            <div>
                <input>Birthyear:</input>
            </div>
            <button type='submit'>set Birthyear</button>
            </form>
        </div>
    )



}


export default SetBirthyear
